Storyline:

    In 1876 Dawson wants to prevent a train from getting to Tomahawk CO on time, to keep it from competing with his stage coach line. Kit, who must get the train to its goal, forces Johnny aboard as the needed passenger. Madame Adelaide's showgirls (including Marilyn as Clara) ride along and, en route to Tomahawk, join Johnny in &quot;Oh, What a Forward Young Man You Are.&quot;



